import React from 'react';
import Header from './Header';
import DocumentList from './DocumentList';
import Tabs from './Tabs';
import Result from './Result';
import './styles.css';

function App() {
  return (
    <div>
      <Header />
      <div className="container">
        <DocumentList />
        <Tabs />
        <Result />
      </div>
    </div>
  );
}

export default App;
